import Navbar from "../components/Navbar";
import Side from "../components/Side";
import Sidebar from "../components/Sidebar";

export default function LikedVideos({userinf}){
    return (
        <>
            <Navbar />
            <div className="main">
                <Side />
                <Sidebar />
                <div className="main-scroll">
                    <div className="inner">
                        liked videos
                    </div>
                </div>
            </div>
        </>
    )
}
